import React from 'react';
import axisos from 'axios';

class App extends React.Component {
  state = {
    details: [],
  }

  componentDidMount() {
    let data;
    axisos.get('http://localhost:8000/employee/')
      .then(res => 
        {
          data = res.data;
          this.setState({details: data});
        })
      .catch(err => console.log(err));
  }
  render() {
    return (
      <div>
        <h1>Employee List</h1>
        {this.state.details.map((detail) => (
          <div key={detail.id}>
            <h1>{detail.name}</h1>
            <span>{detail.email}</span>
          </div>
        ))}
      </div>
    );
  }
}


export default App;
